import logo from './logo.png';
import './App.css';
import NoteVoicingWizard from './components/NoteVoicingWizard';
import $ from 'jquery';
import React, { Component } from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <button className="clicker">
            <img src={logo} className="App-logo" alt="logo" />
          </button>
          <Link to="/wizard" className="btn btn-primary">Wizard</Link>
        </header>
        <Routes>
          <Route path='/wizard' component={NoteVoicingWizard} />
        </Routes>
      </div>
    </Router>
  );
}

$(document).on('click', '.clicker', function() {
  $('.App-logo').toggleClass('paused');
  console.log("triggered");
});

export default App;
